import { BrowserRouter as Router,Route } from 'react-router-dom';
import './App.css';
import Home from './components/home';
import Nav from './components/Nav'
function App(){

  return (
    <div className="App">
      <Router>
        <Nav/>
        <Route path="/"><Home/></Route>
      </Router>
    </div>
  );
}

export default App;
